INSERT INTO Feedback (user_id, app_discovery, app_enjoyment, improvement_suggestions, similar_apps, most_useful_feature) VALUES (1, 'Found it through a friend recommendation', 'The app is very user-friendly and intuitive', 'Add dark mode and improve loading times', 'FitBit, MyFitnessPal, Nike Training Club', 'Workout tracking');
INSERT INTO Feedback (user_id, app_discovery, app_enjoyment, improvement_suggestions, similar_apps, most_useful_feature) VALUES (2, 'Social media advertisement', 'Enjoying the customized workout plans', 'Need more variety in beginner workouts', 'Strava, Fitbod', 'Exercise library');
INSERT INTO Feedback (user_id, app_discovery, app_enjoyment, improvement_suggestions, similar_apps, most_useful_feature) VALUES (3, 'Google Play Store', 'Great interface but sometimes crashes', 'Fix stability issues and add more yoga routines', 'Peloton, Apple Fitness+', 'Progress tracking');
INSERT INTO Feedback (user_id, app_discovery, app_enjoyment, improvement_suggestions, similar_apps, most_useful_feature) VALUES (4, 'Instagram ad', 'Love the community challenges', 'Add ability to connect with more friends', 'Adidas Training, JEFIT', 'Community challenges');
INSERT INTO Feedback (user_id, app_discovery, app_enjoyment, improvement_suggestions, similar_apps, most_useful_feature) VALUES (5, 'App Store recommendation', 'The nutrition tracking is excellent', 'Would like more recipe suggestions', 'MyFitnessPal, Lose It!', 'Nutrition tracking');
INSERT INTO Feedback (user_id, app_discovery, app_enjoyment, improvement_suggestions, similar_apps, most_useful_feature) VALUES (6, 'YouTube review', 'Great for tracking my weight training', 'Need better syncing with Apple Health', 'Strong, FitNotes', 'Weight progression charts');
INSERT INTO Feedback (user_id, app_discovery, app_enjoyment, improvement_suggestions, similar_apps, most_useful_feature) VALUES (7, 'Fitness blog', 'Perfect for my home workouts', 'Add more equipment-free exercises', 'Home Workout, Seven', 'Home workout routines');
INSERT INTO Feedback (user_id, app_discovery, app_enjoyment, improvement_suggestions, similar_apps, most_useful_feature) VALUES (8, 'Personal trainer recommended it', 'Helps me stay motivated', 'Would like more achievement badges', 'Nike Training Club, Aaptiv', 'Workout reminders');
INSERT INTO Feedback (user_id, app_discovery, app_enjoyment, improvement_suggestions, similar_apps, most_useful_feature) VALUES (9, 'Facebook ad', 'Great for tracking runs', 'Need better GPS accuracy', 'Strava, Runkeeper', 'Running analytics');
INSERT INTO Feedback (user_id, app_discovery, app_enjoyment, improvement_suggestions, similar_apps, most_useful_feature) VALUES (10, 'Friend showed me', 'Love the interval timer', 'Add more HIIT workout varieties', 'Interval Timer, Tabata Timer', 'Interval training');
INSERT INTO Feedback (user_id, app_discovery, app_enjoyment, improvement_suggestions, similar_apps, most_useful_feature) VALUES (11, 'Reddit recommendation', 'Great for tracking my lifting progress', 'Add 1RM calculation feature', 'Strong, Fitbod', 'Strength progression');
